import React from "react";
import ReactDOM from "react-dom";
import ThreeScene from "./component/ThreeScene";
import PanelComponent from "./component/PanelComponent";

//import './index.css';
import Appy from './App';
import * as serviceWorker from './serviceWorker';

import "../src/css/index.css"
import "../src/css/tooltip.css"
import "../src/css/courtain.css"
import "../src/css/worlds.css"
import "../src/css/levels.css"
import "../src/css/game.css"

// import './blockly-react/src/index.css';
//import Appy from './blockly-react/src/App';
//import * as serviceWorker from './blockly-react/src/serviceWorker';

function App() {
  return (
    <div
      className="App"
      style={{
        display: "flex",
        flexDirection: "column",
        alignItems: "center"
      }}
    >
      <PanelComponent />
      <ThreeScene />
      {/* <BlocklyWorkspace/> */}
      <Appy/>
    </div>
  );
}

const rootElement = document.getElementById("root");
ReactDOM.render(<App />, rootElement);


//ReactDOM.render(<App />, document.getElementById('root'));

// If you want your app to work offline and load faster, you can change
// unregister() to register() below. Note this comes with some pitfalls.
// Learn more about service workers: https://bit.ly/CRA-PWA
serviceWorker.unregister();
